description:
This adds support for logging using NLog in Encel. After installing this package you need to configure Encel to use the NLogFactory in EncelConfig.cs.

      config.UseLogger(new NLogFactory());

      Encel is a lightweight flat-file CMS that let's you create web pages using Markdown and Shortcodes.

summary:
Gladdress.com API Client Library

Usage:

GladdressProfile gladdressProfile = new GladdressProfile("046632BC-8B3A-485D-8213-9527132C97C9");
List<string> fields = gladdressProfile->GetFields();
var firstName = gladdressProfile.Get("FirstName");

description:
Extension that enables the usage of unit-of-work patterns in non-web applications. 
You could look at this as being the equivalent of InRequestScope from web environments in console applications and services.
The unit-of-work scopes are kept consistent across async calls and tasks.

Setup:
    _kernel.Bind<IService>().To<Service>().InUnitOfWorkScope();
    
Usage:
    using(UnitOfWorkScope.Create()){
        // resolves, async/await, manual TPL ops, etc    
    }
